import './ConsoLayout.css';

function ConsoLayout({ data, logo, type, id, alt }) {
    return (
        <div className='consoLayout'>
            <div id={id} className='consoLogo'>
                <img src={logo} alt={alt} />
            </div>
            <div className='infosContainer'>
                <p className='bold'>
                    {data}kCal
                </p>
                <p className='grey'>
                    {type}
                </p>
            </div>
        </div>
    );
}

export default ConsoLayout;
